import React, { useState } from 'react';
import { ChevronDown } from 'lucide-react';

const Navigation = () => {
  const [activeDropdown, setActiveDropdown] = useState(null);

  const handleDropdownToggle = (dropdown) => {
    setActiveDropdown(activeDropdown === dropdown ? null : dropdown);
  };

  return (
    <nav className="w-full bg-white/80 backdrop-blur-sm border-b border-gray-200/50 px-6 py-4">
      <div className="flex items-center justify-between max-w-7xl mx-auto">
        {/* Logo */}
        <div className="flex items-center">
          <div className="text-3xl font-bold text-lime-500">
            ST
            <span className="relative">
              O
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-3 h-3 bg-gray-800 rounded-full"></div>
            </span>
            <span className="relative">
              Q
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-2 h-2 bg-gray-800 rounded-full"></div>
            </span>
          </div>
        </div>

        {/* Center Navigation Menu */}
        <div className="hidden md:flex items-center space-x-8">
          {/* Industries Dropdown */}
          <div className="relative">
            <button
              onClick={() => handleDropdownToggle('industries')}
              className="flex items-center space-x-1 text-gray-700 hover:text-gray-900 font-medium transition-colors"
            >
              <span>Industries</span>
              <ChevronDown className={`w-4 h-4 transition-transform ${activeDropdown === 'industries' ? 'rotate-180' : ''}`} />
            </button>
            {activeDropdown === 'industries' && (
              <div className="absolute top-full left-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-2 z-50">
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Agriculture</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Food & Beverage</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Retail</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Healthcare</a>
              </div>
            )}
          </div>

          {/* Services Dropdown */}
          <div className="relative">
            <button
              onClick={() => handleDropdownToggle('services')}
              className="flex items-center space-x-1 text-gray-700 hover:text-gray-900 font-medium transition-colors"
            >
              <span>Services</span>
              <ChevronDown className={`w-4 h-4 transition-transform ${activeDropdown === 'services' ? 'rotate-180' : ''}`} />
            </button>
            {activeDropdown === 'services' && (
              <div className="absolute top-full left-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-2 z-50">
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Supply Chain</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Logistics</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Analytics</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Consulting</a>
              </div>
            )}
          </div>

          {/* Pricing */}
          <a href="#" className="text-gray-700 hover:text-gray-900 font-medium transition-colors">
            Pricing
          </a>

          {/* Resources Dropdown */}
          <div className="relative">
            <button
              onClick={() => handleDropdownToggle('resources')}
              className="flex items-center space-x-1 text-gray-700 hover:text-gray-900 font-medium transition-colors"
            >
              <span>Resources</span>
              <ChevronDown className={`w-4 h-4 transition-transform ${activeDropdown === 'resources' ? 'rotate-180' : ''}`} />
            </button>
            {activeDropdown === 'resources' && (
              <div className="absolute top-full left-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-2 z-50">
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Blog</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Case Studies</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Documentation</a>
                <a href="#" className="block px-4 py-2 text-gray-700 hover:bg-gray-50">Support</a>
              </div>
            )}
          </div>

          {/* About */}
          <a href="#" className="text-gray-700 hover:text-gray-900 font-medium transition-colors">
            About
          </a>
        </div>

        {/* Right Side Buttons */}
        <div className="flex items-center space-x-4">
          <button className="text-gray-700 hover:text-gray-900 font-medium transition-colors">
            Log in
          </button>
          <button className="bg-lime-400 hover:bg-lime-500 text-gray-800 font-semibold px-6 py-2 rounded-full transition-colors">
            Sign up
          </button>
        </div>

        {/* Mobile Menu Button */}
        <div className="md:hidden">
          <button className="text-gray-700 hover:text-gray-900">
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          </button>
        </div>
      </div>

      {/* Click outside to close dropdowns */}
      {activeDropdown && (
        <div 
          className="fixed inset-0 z-40" 
          onClick={() => setActiveDropdown(null)}
        />
      )}
    </nav>
  );
};

export default Navigation;
